section {
  // Default card styles.
  .card {
    .card-body {
      position: relative;
      color: text-color();
      padding: 1.5rem;

      @include media-breakpoint-up(lg) {
        //padding: 1.75rem;
      }

      h1,
      h2,
      h3,
      h4,
      h5 {
        color: text-color();
      }

      .headline {
        margin-bottom: 1rem;

        @include media-breakpoint-up(lg) {
          //margin-bottom: 1rem;
        }

        .superheadline {
          color: text-color("light");
          text-transform: uppercase;
        }

        .subheadline {
          color: text-color("light");
          margin-top: 5px;
        }

        &:last-child {
          margin-bottom: 0;
        }
      }

      h2.headline {
        margin-bottom: 0.9rem;
      }

      h3.headline {
        margin-bottom: 0.8rem;
      }

      h4.headline {
        margin-bottom: 0.7rem;
      }

      h5.headline {
        margin-bottom: 0.6rem;
      }

      > * {
        margin-top: 0.75rem;
        margin-bottom: 0.75rem;

        &:first-child {
          margin-top: 0;
        }

        &:last-child {
          margin-bottom: 0;
        }
      }

      p {
        &:last-child {
          margin-bottom: 0;
        }
      }
    }

    &.flat {
      border: none !important;
      box-shadow: none !important;
    }

    &.bottom-highlight {
      position: relative;
      padding-bottom: 85px;
      //margin-bottom: 25px;

      &::after {
        content: "";
        width: 48px;
        position: absolute;
        height: 2px;
        bottom: 35px;
        left: 0;
        background-image: linear-gradient(to right, #bf1819, rgba(128, 0, 128, 0.8));
      }
    }

    &.transparent {
      background-color: transparent !important;

      .card-body {
        color: inherit;

        h1,
        h2,
        h3,
        h4,
        h5,
        .headline {
          color: inherit;
          letter-spacing: -0.1px;
        }
      }
    }

    &.no-y-padding {
      .card-body {
        padding-top: 0 !important;
        padding-bottom: 0 !important;

        .icon-wrapper {
          top: 0 !important;
        }
      }

      figure {
        &.figure-cards {
          padding-top: 0;
          padding-bottom: 1.25rem;
          top: 0 !important;
        }
      }
    }

    &.no-x-padding {
      .card-body {
        padding-left: 0 !important;
        padding-right: 0 !important;
      }

      figure {
        &.figure-cards {
          padding-left: 0;
          padding-right: 0;
          left: 0 !important;
        }
      }

      &.card-icon-image-left,
      &.card-icon-image-lg-left,
      &.card-icon-image-xl-left,
      &.card-icon-image-xxl-left,
      &.card-icon-image-xxxl-left,
      &.card-icon-image-xxxxl-left,
      &.card-icon-image-xxxxxl-left {
        .card-body {
          padding-left: 1.25rem !important;
        }
      }

      &.card-icon-image-right,
      &.card-icon-image-lg-right,
      &.card-icon-image-xl-right,
      &.card-icon-image-xxl-right,
      &.card-icon-image-xxxl-right {
        .card-body {
          padding-right: 1.25rem !important;
        }
      }
    }

    &.no-border {
      border: none !important;
    }

